import React, { Component } from 'react'
import logo2 from '../images/logo2.png'

export default class Home extends Component {
    render() {
        return (
            <>
            <div className="usful-numbers">
            <a href = "/" > 
         <img src ={logo2} alt="logo"
          style={{
            width:"150px",
            height:"100px",
          }}/> 
      </a>

            </div>





            </>
        )
    }
}
